import React from "react";
import "./home.css";
import AliceCarousel from "react-alice-carousel";
import "react-alice-carousel/lib/alice-carousel.css";
const HomePage = () => {
  return (
    <div>
      <AliceCarousel
        items={[
          <div key="1">
            <img
              src="https://media.istockphoto.com/id/1033729610/photo/pretty-young-woman-stylishly-dressed-in-a-straw-hat-with-color-bags-after-shopping-isolated.jpg?s=612x612&w=0&k=20&c=Z3wK_UE5j6RlQkvmR1WytDS3hbfVD6ucnCiknqGnqt8="
              alt="Image 1"
            />
          </div>,
          <div key="2">
            <img
              src="https://st3.depositphotos.com/5444644/15662/i/450/depositphotos_156625116-stock-photo-young-woman-with-shopping-bags.jpg"
              alt="Image 2"
            />
          </div>,
          <div key="3">
            <img
              src="https://static.toiimg.com/thumb/63396973.cms?resizemode=75&width=1200&height=900"
              alt="Image 3"
            />
          </div>,
        ]}
      />
    </div>
  );
};

export default HomePage;
